import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import "react-responsive-carousel/lib/styles/carousel.min.css";

import "../styles/carousel.css";

import { Carousel } from 'react-responsive-carousel';

import Grid from '@material-ui/core/Grid';

export default class videoCarousel extends Component {
    render () {
        return (
            <Carousel showThumbs={false}>
                <div>
                <iframe src="https://player.vimeo.com/video/247003506" width="640" height="360" frameborder="0" allow="autoplay; fullscreen" allowfullscreen></iframe>
<p><a href="https://vimeo.com/247003506">Nectar Summer Launch Party</a> from <a href="https://vimeo.com/user17714417">Walker Floyd</a> on <a href="https://vimeo.com">Vimeo</a>.</p>
                </div>
            </Carousel>
        )
    }
}
